import React from 'react'
import { connect } from "react-redux";
import ApiRequest from "../../services/api/Api-request";

/**
 * SearchMovies Component
 * Form to search movie by title, original title
 * @param {*} props
 */
const Login = (props) =>{

    const onSubmit = (event) => {
        event.preventDefault();
        const params = new URLSearchParams();
        params.append("user", "developer@perseo.tv");
        params.append("pass", "e77989ed21758e78331b20e477fc5582");
        params.append("device", "Web");
        props.login(params);      
      };

    return (
        <div>
            <form onSubmit={onSubmit}>
                <label htmlFor="user">User</label>
                <input type="text" name="user" id="user" />
                <label htmlFor="pass">Password</label>
                <input type="text" name="pass" id="pass" />
                <button type="submit">Entrar</button>
            </form>
        </div>
    )
}


const mapStateToProps = (state) => ({ state: state });

const mapDispatchToProps = (dispatch) => ({
    login: (params) => {
    ApiRequest.Session.Login(params)(dispatch);
  },
});

const connectedLogin = connect(
  mapStateToProps,
  mapDispatchToProps
)(Login);

export default connectedLogin;
